  function rgbToId(r,g,b) { return (r<<16) | (g<<8) | b; }

  function initMaps() {
    infoById.clear(); iso2ById.clear(); ownerIndexById.clear();
    for (const hex in PALETTE) {
      const p = PALETTE[hex];
      const r = parseInt(hex.slice(1,3),16);
      const g = parseInt(hex.slice(3,5),16);
      const b = parseInt(hex.slice(5,7),16);
      const id = rgbToId(r,g,b);
      infoById.set(id, p);
      iso2ById.set(id, p.iso2);
      ownerIndexById.set(id, 0);
    }
  }

  // BBox & size
  const bboxByKey = new Map();
  const sizeByKey = new Map();
  for (const lp of LABEL_POINTS) {
    const bb = [lp.bx1, lp.by1, lp.bx2, lp.by2];
    bboxByKey.set(lp.key, bb);
    sizeByKey.set(lp.key, [Math.max(1, bb[2]-bb[0]), Math.max(1, bb[3]-bb[1])]);
  }

  let baseScale = 1.0, baseOffsetX = 0, baseOffsetY = 0;

  function fitView() {
    const vw = canvas.width, vh = canvas.height;
    const sx = vw / off.width;
    const sy = vh / off.height;
    baseScale = Math.min(sx, sy) * 0.92;
    baseOffsetX = (vw - off.width * baseScale)/2;
    baseOffsetY = (vh - off.height * baseScale)/2;
    scale = baseScale;
    offsetX = baseOffsetX;
    offsetY = baseOffsetY;
  }

  function prepare() {
    try {
      off.width = img.naturalWidth;
      off.height = img.naturalHeight;
      offCtx.drawImage(img, 0, 0);

      initMaps();

      const idData = offCtx.getImageData(0, 0, off.width, off.height).data;
      id32 = new Uint32Array(off.width * off.height);

      let j = 0;
      for (let y=0; y<off.height; y++) {
        for (let x=0; x<off.width; x++, j++) {
          const i = j*4;
          const id = rgbToId(idData[i], idData[i+1], idData[i+2]);
          id32[j] = id;
        }
      }

      buf.width = off.width;
      buf.height = off.height;

      fitView();
      draw();
    } catch (e) {
      showError("  (getImageData) .\n (F12)  !\n\n: " + e);
    }
  }

  function clamp(v, a, b) { return Math.max(a, Math.min(b, v)); }

  function drawStar(x, y, r) {
    const spikes = 5;
    const rot = Math.PI / 2 * 3;
    const step = Math.PI / spikes;
    let angle = rot;
    ctx.beginPath();
    ctx.moveTo(x, y - r);
    for (let i=0; i<spikes; i++) {
      ctx.lineTo(x + Math.cos(angle) * r, y + Math.sin(angle) * r);
      angle += step;
      ctx.lineTo(x + Math.cos(angle) * (r*0.45), y + Math.sin(angle) * (r*0.45));
      angle += step;
    }
    ctx.lineTo(x, y - r);
    ctx.closePath();
    ctx.fill();
    ctx.stroke();
  }

  function drawDiamond(x, y, r) {
    ctx.beginPath();
    ctx.moveTo(x, y - r);
    ctx.lineTo(x + r, y);
    ctx.lineTo(x, y + r);
    ctx.lineTo(x - r, y);
    ctx.closePath();
    ctx.fill();
    ctx.stroke();
  }

  function rectIntersects(a, b) {
    return !(a.x2 < b.x1 || a.x1 > b.x2 || a.y2 < b.y1 || a.y1 > b.y2);
  }

  function drawLabelsAndMarkers() {
    const mode = labelMode.value;
    if (mode === "off") return;

    const z = scale / baseScale;
    const base = (labelSize.value === "sm") ? 10 : (labelSize.value === "lg" ? 14 : 12);
    const fs = clamp(base * Math.pow(z, 0.45), 10, 28);

    ctx.setTransform(1,0,0,1,0,0);
    ctx.font = `${fs}px system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif`;
    ctx.textAlign = "center";
    ctx.textBaseline = "middle";

    ctx.lineWidth = clamp(fs * 0.20, 2, 4.2);
    ctx.strokeStyle = "rgba(255,255,255,0.88)";
    ctx.fillStyle = "rgba(0,0,0,0.88)";

    const capitalKeys = new Set(Object.values(CAPITAL_KEY_BY_ISO2));

    function unitLabelForKey(key) {
      if (MODE !== "GAME") return null;
      const m = (GAME.unitsByKey && GAME.unitsByKey[key]) ? GAME.unitsByKey[key] : null;
      if (!m) return null;
      const parts = [];
      for (const [o,v] of Object.entries(m)) {
        const n = Number(v||0);
        if (n > 0) parts.push(`${o}:${n}`);
      }
      if (!parts.length) return null;
      return parts.join(" ");
    }

    function isImportant(lp) {
      const t = (lp.type || "").toLowerCase();

      // Always treat Korea/North Korea labels as important (small area, readability first)
      const isKRorKP = (lp.iso2 === "KR" || lp.iso2 === "KP");

      const isCapital = capitalKeys.has(lp.key);
      const isSAR = t.includes("special administrative region");
      const isSejongLike = t.includes("special self-governing city") || t.includes("special self-governing province");

      // KP "Special City" like Kaesong should behave like a special marker/important label
      const isKPSpecialCity = (lp.iso2 === "KP") && t.includes("special city");

      const isKRMetro = (lp.iso2==="KR") && (t.includes("metropolitan city") || t.includes("special city"));
      const isTWCity = (lp.iso2==="TW") && (t === "city");

      return isKRorKP || isKPSpecialCity ||
             ((isCapital && toggleCapitals.checked) ||
              (isSAR && toggleSpecial.checked) ||
              isSejongLike || isKRMetro || isTWCity);
    }

    const items = LABEL_POINTS.map(lp => {
      const t = (lp.type || "").toLowerCase();
      const isCapital = capitalKeys.has(lp.key);
      const isSAR = t.includes("special administrative region");
      const isSpecialMarker = (isCapital && toggleCapitals.checked) || (isSAR && toggleSpecial.checked);
      const important = isImportant(lp);
      return {...lp, isCapital, isSAR, important, isSpecialMarker};
    });

    items.sort((a,b) => (b.isCapital - a.isCapital) || (b.isSAR - a.isSAR) || (b.important - a.important));

    const placed = [];
    const minDim = fs * 3.0;
    const minArea = fs * fs * 20;
    const padding = clamp(fs * 0.35, 3, 8);

    for (const lp of items) {
      let wantLabel = false;
      if (mode === "major") wantLabel = lp.important || lp.isSpecialMarker;
      else if (mode === "all") wantLabel = true;
      else if (mode === "zoom") {
        if (lp.important || lp.isSpecialMarker) wantLabel = true;
        else wantLabel = (z >= 1.60);
      }

      const sx0 = lp.x * scale + offsetX;
      const sy0 = lp.y * scale + offsetY;
      if (sx0 < -220 || sy0 < -220 || sx0 > canvas.width + 220 || sy0 > canvas.height + 220) continue;

      const mr = clamp(fs*0.55, 6, 12);
      if (lp.isCapital && toggleCapitals.checked) {
        ctx.save();
        ctx.fillStyle = "rgba(255,255,255,0.98)";
        ctx.strokeStyle = "rgba(0,0,0,0.90)";
        ctx.lineWidth = 2.4;
        drawStar(sx0, sy0 - fs*1.05, mr);
        ctx.restore();
      } else if (lp.isSAR && toggleSpecial.checked) {
        ctx.save();
        ctx.fillStyle = "rgba(255,255,255,0.98)";
        ctx.strokeStyle = "rgba(0,0,0,0.90)";
        ctx.lineWidth = 2.4;
        drawDiamond(sx0, sy0 - fs*1.05, mr);
        ctx.restore();
      }

      if (!wantLabel) continue;

      if (!lp.important && mode !== "all") {
        const s = sizeByKey.get(lp.key);
        if (s) {
          const sw = s[0] * scale;
          const sh = s[1] * scale;
          const area = sw * sh;
          if (sw < minDim || sh < fs*1.6 || area < minArea) continue;
        }
      }

      const name = lp.name_ko || lp.name_en || "?";
      const tw = ctx.measureText(name).width;
      const th = fs;

      //       
      const tryOffsets = (lp.important) ? [
        [0,0], [0,-fs*1.1], [0,fs*1.1], [-fs*1.3,0], [fs*1.3,0],
        [-fs*1.0,-fs*1.0], [fs*1.0,-fs*1.0], [-fs*1.0,fs*1.0], [fs*1.0,fs*1.0]
      ] : [[0,0]];

      let drawn = false;
      for (const [dx,dy] of tryOffsets) {
        const sx = sx0 + dx;
        const sy = sy0 + dy;

        const r = {
          x1: sx - tw/2 - padding,
          y1: sy - th/2 - padding,
          x2: sx + tw/2 + padding,
          y2: sy + th/2 + padding
        };

        let blocked = false;
        for (const p of placed) {
          if (rectIntersects(r, p)) { blocked = true; break; }
        }

        if (blocked && !lp.important) continue;
        if (blocked && lp.important && dx === 0 && dy === 0) continue;

        ctx.strokeText(name, sx, sy);
        ctx.fillText(name, sx, sy);
        const ul = unitLabelForKey(lp.key);
        if (ul) {
          ctx.save();
          ctx.font = `${clamp(fs*0.82, 9, 22)}px system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif`;
          ctx.strokeText(ul, sx, sy + fs*0.95);
          ctx.fillText(ul, sx, sy + fs*0.95);
          ctx.restore();
        }

        placed.push(r);
        drawn = true;
        break;
      }

      if (!drawn && lp.important) {
        const sx = sx0, sy = sy0;
        ctx.strokeText(name, sx, sy);
        ctx.fillText(name, sx, sy);
        const ul = unitLabelForKey(lp.key);
        if (ul) {
          ctx.save();
          ctx.font = `${clamp(fs*0.82, 9, 22)}px system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif`;
          ctx.strokeText(ul, sx, sy + fs*0.95);
          ctx.fillText(ul, sx, sy + fs*0.95);
          ctx.restore();
        }

        const r = { x1: sx - tw/2 - padding, y1: sy - th/2 - padding, x2: sx + tw/2 + padding, y2: sy + th/2 + padding };
        placed.push(r);
      }
    }
  }

  function draw() {
    if (!id32) return;

    const w = off.width, h = off.height;
    const out = bufCtx.createImageData(w, h);
    const outD = out.data;

    const showCountry = toggleCountry.checked;
    const showInternal = toggleInternal.checked;

    const water = [215, 236, 255];

    for (let idx=0; idx<w*h; idx++) {
      const id = id32[idx];
      if (id === OUTSIDE_ID) {
        outD[idx*4+0] = water[0];
        outD[idx*4+1] = water[1];
        outD[idx*4+2] = water[2];
        outD[idx*4+3] = 255;
        continue;
      }
      const oi = ownerIndexById.get(id) ?? 0;
      const oc = OWNERS[oi].color;
      outD[idx*4+0] = oc[0];
      outD[idx*4+1] = oc[1];
      outD[idx*4+2] = oc[2];
      outD[idx*4+3] = 255;
    }

    const mark = new Uint8Array(w*h);
    for (let y=0; y<h; y++) {
      for (let x=0; x<w; x++) {
        const idx = y*w + x;
        const id = id32[idx];
        if (id === OUTSIDE_ID) continue;

        const right = (x+1<w) ? id32[idx+1] : id;
        const down  = (y+1<h) ? id32[idx+w] : id;

        function classify(other) {
          if (other === id) return 0;
          if (other === OUTSIDE_ID) return 2;
          const a = iso2ById.get(id);
          const b = iso2ById.get(other);
          if (a && b && a !== b) return 2;
          return 1;
        }

        const c = Math.max(classify(right), classify(down));
        if (c === 2 && showCountry) mark[idx] = 2;
        else if (c === 1 && showInternal) mark[idx] = Math.max(mark[idx], 1);
      }
    }

    if (showCountry) {
      const dil = new Uint8Array(w*h);
      for (let y=0; y<h; y++) {
        for (let x=0; x<w; x++) {
          const idx = y*w + x;
          if (mark[idx] !== 2) continue;
          dil[idx] = 2;
          if (x>0) dil[idx-1] = 2;
          if (x+1<w) dil[idx+1] = 2;
          if (y>0) dil[idx-w] = 2;
          if (y+1<h) dil[idx+w] = 2;
        }
      }
      for (let i=0;i<mark.length;i++) if (dil[i]===2) mark[i]=2;
    }

    for (let idx=0; idx<w*h; idx++) {
      const m = mark[idx];
      if (m === 2) {
        outD[idx*4+0] = 10; outD[idx*4+1] = 10; outD[idx*4+2] = 10;
      } else if (m === 1) {
        outD[idx*4+0] = 45; outD[idx*4+1] = 45; outD[idx*4+2] = 45;
      }
    }

    bufCtx.putImageData(out, 0, 0);

    ctx.setTransform(1,0,0,1,0,0);
    ctx.clearRect(0,0,canvas.width,canvas.height);

    ctx.setTransform(scale, 0, 0, scale, offsetX, offsetY);
    ctx.imageSmoothingEnabled = false;
    ctx.drawImage(buf, 0, 0);

    drawLabelsAndMarkers();
  }

  function screenToMap(px, py) {
    const x = (px*devicePixelRatio - offsetX) / scale;
    const y = (py*devicePixelRatio - offsetY) / scale;
    return { x: Math.floor(x), y: Math.floor(y) };
  }

  function getIdAt(px, py) {
    if (!id32) return null;
    const m = screenToMap(px, py);
    if (m.x < 0 || m.y < 0 || m.x >= off.width || m.y >= off.height) return null;
    const id = id32[m.y * off.width + m.x];
    if (id === OUTSIDE_ID) return null;
    // outside color might exist in palette? ignore
    if (!infoById.has(id)) return null;
    return id;
  }

  function zoomAtScreenPoint(cx, cy, factor) {
    const mouseX = cx * devicePixelRatio;
    const mouseY = cy * devicePixelRatio;
    const newScale = clamp(scale * factor, baseScale*0.6, baseScale*50);

    const mx = (mouseX - offsetX) / scale;
    const my = (mouseY - offsetY) / scale;

    offsetX = mouseX - mx * newScale;
    offsetY = mouseY - my * newScale;
    scale = newScale;
    draw();
  }

  function focusKey(key) {
    const bb = bboxByKey.get(key);
    if (!bb) return;
    const [x1,y1,x2,y2] = bb;
    const bw = Math.max(2, x2-x1);
    const bh = Math.max(2, y2-y1);
    const pad = 0.22;

    const vw = canvas.width;
    const vh = canvas.height;

    const targetScale = clamp(Math.min((vw*(1-pad))/bw, (vh*(1-pad))/bh), baseScale*0.9, baseScale*50);

    const cx = (x1+x2)/2;
    const cy = (y1+y2)/2;

    scale = targetScale;
    offsetX = (vw/2) - cx*scale;
    offsetY = (vh/2) - cy*scale;
    draw();
  }

  canvas.addEventListener("mousemove", (e) => {
    if (dragging) {
      const dx = (e.clientX - lastX);
      const dy = (e.clientY - lastY);
      if (!dragMoved) {
        const dist = Math.hypot(e.clientX - downX, e.clientY - downY);
        if (dist > 4) dragMoved = true;
      }
      offsetX += dx * devicePixelRatio;
      offsetY += dy * devicePixelRatio;
      lastX = e.clientX; lastY = e.clientY;
      draw();
      return;
    }

    const id = getIdAt(e.clientX, e.clientY);
    if (!id) { hoverTxt.textContent = "-"; return; }
    const info = infoById.get(id);
    hoverTxt.textContent = `${info?.iso2 || "?"}  ${info?.name_ko || info?.name_en || "?"}`;
  });

  canvas.addEventListener("mousedown", (e) => {
    if (modalBack.style.display === "flex") return;
    dragging = true;
    dragMoved = false;
    downX = lastX = e.clientX;
    downY = lastY = e.clientY;
  });
  window.addEventListener("mouseup", () => { dragging = false; });

  canvas.addEventListener("wheel", (e) => {
    e.preventDefault();
    const zoomFactor = (e.deltaY < 0) ? 1.15 : 0.88;
    zoomAtScreenPoint(e.clientX, e.clientY, zoomFactor);
  }, { passive: false });

  canvas.addEventListener("dblclick", (e) => {
    e.preventDefault();
    e.stopPropagation();
  });


  // =========================
  // Turn-based Game Mode (USER vs AI)
  // =========================
  let MODE = "FREE"; // "FREE" | "GAME"
  let ADJ = null;    // { hasData, neighbors: { [key]: [neighborKeys...] } }

  const modeFreeBtn = document.getElementById("modeFree");
  const modeGameBtn = document.getElementById("modeGame");
  const gameBox = document.getElementById("gameBox");
  const btnGameStart = document.getElementById("btnGameStart");
  const btnGamePass = document.getElementById("btnGamePass");
  const btnActionAttack = document.getElementById("btnActionAttack");
  const btnActionMove = document.getElementById("btnActionMove");
  const btnActionNavalMove = document.getElementById("btnActionNavalMove");
  const facilityTypeSel = document.getElementById("facilityType");
  const btnActionBuild = document.getElementById("btnActionBuild");
  const btnActionRecruit = document.getElementById("btnActionRecruit");
  const btnActionSpy = document.getElementById("btnActionSpy");
  const btnGameReset = document.getElementById("btnGameReset");
  const btnTechUnlock = document.getElementById("btnTechUnlock");
  // v3 bottom panel
  const bpTitle = document.getElementById("bpTitle");
  const bpMeta = document.getElementById("bpMeta");
  const bpOwner = document.getElementById("bpOwner");
  const bpVis = document.getElementById("bpVis");
  const bpRes = document.getElementById("bpRes");
  const bpGold = document.getElementById("bpGold");
  const bpPop = document.getElementById("bpPop");
  const bpSupport = document.getElementById("bpSupport");
  const bpStability = document.getElementById("bpStability");
  const bpFacilities = document.getElementById("bpFacilities");
  const bpUnits = document.getElementById("bpUnits");
  const bpSeen = document.getElementById("bpSeen");
  const bpModeTag = document.getElementById("bpModeTag");

  const aiCountSel = document.getElementById("aiCount");
  const gameStatusEl = document.getElementById("gameStatus");
  const gameHintEl = document.getElementById("gameHint");
  const gameLogEl = document.getElementById("gameLog");
  const GAME = {
    started: false,
    finished: false,
    winner: null,
    phase: "IDLE", // IDLE | PICK_HOME | PICK_FROM | PICK_TO | FINISHED
    userOwnerId: "A",
    aiOwnerIds: ["B"],
    territoriesByOwnerId: {},
    ports: new Set(),
    facilitiesByRegion: {},
    units: [],
    unitsByKey: {},
    selectedToKey: null,
    counts: { total: 0, neutral: 0 },
    selectedFromKey: null,
    selectedFromId: null,
    goldByOwner: {},
    techPointsByOwner: {},
    unlockedTechByOwner: {},
  };

  //  ( TurnGameService.TECH_DEFS  )
  const TECH_CATALOG = [
    { code: "TAX", name: " ", cost: 5, desc: "  +10%" },
    { code: "STEEL", name: " ", cost: 5, desc: " +10%" },
    { code: "CRYPTO", name: " ", cost: 5, desc: "  " },
  ];


  function updateGoldUi() {
    if (!bpGold) return;
    const g = (GAME.goldByOwner && GAME.userOwnerId) ? GAME.goldByOwner[GAME.userOwnerId] : null;
    if (g === null || g === undefined) {
      bpGold.textContent = "-";
    } else {
      bpGold.textContent = Number(g).toLocaleString();
    }
  }

  function setMode(newMode) {
    MODE = newMode;
    if (modeFreeBtn) modeFreeBtn.dataset.active = (MODE === "FREE") ? "true" : "false";
    if (modeGameBtn) modeGameBtn.dataset.active = (MODE === "GAME") ? "true" : "false";
    if (gameBox) gameBox.style.display = (MODE === "GAME") ? "block" : "none";

    //   ,      
    try { if (MODE === "GAME") closeModal(); } catch (_) {}
    if (bpModeTag) bpModeTag.textContent = MODE;
    updateGameUi();
  }

  function setGameStatus(t) {
    if (!gameStatusEl) return;
    gameStatusEl.textContent = t || "-";
  }

  function setGameHint(t) {
    if (!gameHintEl) return;
    gameHintEl.textContent = t || "-";
  }

  function setGameLog(lines) {
    if (!gameLogEl) return;
    gameLogEl.textContent = (lines && lines.length) ? lines.join("\n") : "";
  }

  function ownerIdOfKey(key) {
    if (!key) return "NEUTRAL";
    return (LAST_OCCUPATION_BY_KEY && LAST_OCCUPATION_BY_KEY[key]) ? LAST_OCCUPATION_BY_KEY[key] : "NEUTRAL";
  }

  function neighborsOf(key) {
    if (!ADJ || !ADJ.neighbors) return [];
    return ADJ.neighbors[key] || [];
  }

  function hasUnitAt(key) {
    const u = GAME.unitsByKey && GAME.unitsByKey[key];
    if (!u) return false;
    // u: { [ownerId]: soldiers }
    return (u[GAME.userOwnerId] && u[GAME.userOwnerId] > 0);
  }

  function canAttack() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedFromKey || !GAME.selectedToKey) return false;
    if (ownerIdOfKey(GAME.selectedFromKey) !== GAME.userOwnerId) return false;
    const toOwner = ownerIdOfKey(GAME.selectedToKey);
    //    MOVE   
    if (toOwner === "NEUTRAL") return false;
    if (toOwner === GAME.userOwnerId) return false;
    if (!hasUnitAt(GAME.selectedFromKey)) return false;
    const ns = neighborsOf(GAME.selectedFromKey);
    return Array.isArray(ns) && ns.includes(GAME.selectedToKey);
  }

  function canMove() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedFromKey || !GAME.selectedToKey) return false;
    if (ownerIdOfKey(GAME.selectedFromKey) !== GAME.userOwnerId) return false;
    const toOwner = ownerIdOfKey(GAME.selectedToKey);
    //    ( ) MOVE 
    if (!(toOwner === GAME.userOwnerId || toOwner === "NEUTRAL")) return false;
    if (!hasUnitAt(GAME.selectedFromKey)) return false;
    const ns = neighborsOf(GAME.selectedFromKey);
    return Array.isArray(ns) && ns.includes(GAME.selectedToKey);
  }

  function canNavalMove() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedFromKey || !GAME.selectedToKey) return false;
    if (ownerIdOfKey(GAME.selectedFromKey) !== GAME.userOwnerId) return false;
    if (!hasUnitAt(GAME.selectedFromKey)) return false;
    //      
    return GAME.ports && GAME.ports.has(GAME.selectedFromKey);
  }

  function canBuildFacility() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedFromKey) return false;
    if (ownerIdOfKey(GAME.selectedFromKey) !== GAME.userOwnerId) return false;
    return true;
  }

  function canRecruit() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedFromKey) return false;
    if (ownerIdOfKey(GAME.selectedFromKey) !== GAME.userOwnerId) return false;
    //     .   .
    return true;
  }

  
  function canSpy() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    if (!GAME.selectedToKey) return false;
    //     (  )
    return true;
  }


  function canTechUnlock() {
    if (MODE !== "GAME") return false;
    if (!GAME.started || GAME.finished) return false;
    return true;
  }

async function loadAdjacencyOnce() {
    if (ADJ) return ADJ;
    try {
      ADJ = await window.OCC_API?.getAdjacency?.();
    } catch (e) {
      ADJ = null;
      // console.warn("adjacency load failed:", e);
    }
    return ADJ;
  }

  function updateGameUi() {
    if (MODE !== "GAME") return;

    //  
    const running = GAME.started && !GAME.finished;
    // v3:   / (  disabled    )
    if (btnActionAttack) btnActionAttack.disabled = !running || !canAttack();
    if (btnActionMove) btnActionMove.disabled = !running || !canMove();
    if (btnActionNavalMove) btnActionNavalMove.disabled = !running || !canNavalMove();
    if (btnActionBuild) btnActionBuild.disabled = !running || !canBuildFacility();
    if (btnActionRecruit) btnActionRecruit.disabled = !running || !canRecruit();
    if (btnActionSpy) btnActionSpy.disabled = !running || !canSpy();
    if (btnTechUnlock) btnTechUnlock.disabled = !running || !canTechUnlock();

    if (btnGamePass) btnGamePass.disabled = !running;
    if (aiCountSel) aiCountSel.disabled = running;    if (btnGameReset) btnGameReset.disabled = false;

    if (!GAME.started) {
      setGameStatus("");
      if (GAME.phase === "PICK_HOME") setGameHint(" '  ' .");
      else setGameHint("   ,    .");
      setGameLog([]);
      return;
    }

    if (GAME.finished) {
      const w = GAME.winner ? GAME.winner.toUpperCase() : "DRAW";
      const wTxt = (w === "DRAW") ? "" : `: ${w}`;
      setGameHint(" : " + wTxt + "    [ ]  []  ");
      return;
    }

    // started + running
    if (GAME.phase === "PICK_FROM") {
      setGameHint(" ( )   ,     (////) .");
    } else if (GAME.phase === "PICK_TO") {
      setGameHint("    . ( / ,    )");
    } else if (GAME.phase === "PICK_HOME") {
      setGameHint(" '  ' .");
    } else {
      setGameHint("-");
    }
  }

  function applyGameState(s) {
    if (!s || typeof s !== "object") return;

    GAME.started = !!s.started;
    GAME.finished = !!s.finished;
    GAME.winner = (s.winnerOwnerId === null || s.winnerOwnerId === undefined) ? null : String(s.winnerOwnerId);

    GAME.userOwnerId = s.userOwnerId || "A";
    GAME.aiOwnerIds = Array.isArray(s.aiOwnerIds) ? s.aiOwnerIds.map(String) : ["B"];
    GAME.territoriesByOwnerId = (s.territoriesByOwnerId && typeof s.territoriesByOwnerId === "object") ? s.territoriesByOwnerId : {};
    GAME.ports = new Set(Array.isArray(s.portRegions) ? s.portRegions : []);
    GAME.facilitiesByRegion = (s.facilitiesByRegion && typeof s.facilitiesByRegion === "object") ? s.facilitiesByRegion : {};
    GAME.units = Array.isArray(s.units) ? s.units : [];

    // ()
    GAME.goldByOwner = (s.goldByOwner && typeof s.goldByOwner === "object") ? s.goldByOwner : {};
    GAME.techPointsByOwner = (s.techPointsByOwner && typeof s.techPointsByOwner === "object") ? s.techPointsByOwner : {};
    GAME.unlockedTechByOwner = (s.unlockedTechByOwner && typeof s.unlockedTechByOwner === "object") ? s.unlockedTechByOwner : {};
    GAME.unitsByKey = {};
    for (const u of GAME.units) {
      if (!u || !u.regionKey) continue;
      const k = u.regionKey;
      const o = u.ownerId;
      const sld = Number(u.soldiers || 0);
      if (!GAME.unitsByKey[k]) GAME.unitsByKey[k] = {};
      GAME.unitsByKey[k][o] = (GAME.unitsByKey[k][o] || 0) + sld;
    }

    // 
    const total = (typeof s.totalRegions === "number") ? s.totalRegions : 0;
    const neutral = (typeof s.neutralRegions === "number") ? s.neutralRegions : 0;
    GAME.counts = { total, neutral };

    //  
    const turn = (typeof s.turn === "number") ? s.turn : 0;

    const parts = [];
    const myCnt = Number(GAME.territoriesByOwnerId[GAME.userOwnerId] || 0);
    parts.push(`${GAME.userOwnerId}:${myCnt}`);
    for (const ai of GAME.aiOwnerIds) {
      const c = Number(GAME.territoriesByOwnerId[ai] || 0);
      parts.push(`${ai}:${c}`);
    }
    parts.push(`N:${GAME.counts.neutral}`);
    const cntTxt = parts.join("  ");

    const myGold = (GAME.goldByOwner && GAME.userOwnerId) ? GAME.goldByOwner[GAME.userOwnerId] : null;
    const goldTxt = (myGold === null || myGold === undefined) ? "" : `  |  GOLD:${Number(myGold).toLocaleString()}`;
    const myTp = (GAME.techPointsByOwner && GAME.userOwnerId) ? GAME.techPointsByOwner[GAME.userOwnerId] : null;
    const tpTxt = (myTp === null || myTp === undefined) ? "" : `  |  TP:${Number(myTp).toLocaleString()}`;

    if (GAME.finished) {
      const w = GAME.winner ? GAME.winner.toUpperCase() : "DRAW";
      const wTxt = (w === "DRAW") ? "" : `: ${w}`;
      setGameStatus(` / ${wTxt}  |  ${cntTxt}${goldTxt}${tpTxt}`);
      GAME.phase = "FINISHED";
    } else {
      const day = (typeof s.day === "number") ? s.day : 0;
      setGameStatus(` ${turn} (D+${day}) / USER  |  ${cntTxt}${goldTxt}${tpTxt}`);
    }

    // ( 16)
    const logs = Array.isArray(s.log) ? s.log.slice(-16) : [];
    setGameLog(logs);

    updateGoldUi();

    //   
    if (s.occupation) {
      applyOccupationFromServer(s.occupation);
      draw();
    }
  }
  async function updateBottomPanelByKey(regionKey) {
    if (!regionKey) return;
    try {
      const data = await window.OCC_API?.gameInspect?.(regionKey);
      if (!data) return;

      const name = data.nameKo || data.nameEn || "?";
      const iso2 = data.iso2 || "?";
      if (bpTitle) bpTitle.textContent = `${iso2}  ${name}`;
      if (bpMeta) {
        const f = (MODE === "GAME" && GAME.selectedFromKey) ? `from:${GAME.selectedFromKey}` : null;
        const t = (MODE === "GAME" && GAME.selectedToKey) ? `to:${GAME.selectedToKey}` : null;
        const extra = [f, t].filter(Boolean).join("  ");
        bpMeta.textContent = extra ? `key: ${data.regionKey}  |  ${extra}` : `key: ${data.regionKey}`;
      }

      if (bpOwner) bpOwner.textContent = String(data.ownerId || "-");
      if (bpVis) bpVis.textContent = data.visible ? "" : " ";
      if (bpRes) bpRes.textContent = `${data.resource} +${data.yieldPerTurn}`;
      if (bpPop) bpPop.textContent = (data.population || 0).toLocaleString();

      if (bpSupport) bpSupport.textContent = (data.support === null || data.support === undefined) ? "-" : String(data.support);
      if (bpStability) bpStability.textContent = (data.stability === null || data.stability === undefined) ? "-" : String(data.stability);

      if (bpFacilities) {
        const arr = (data.facilities && Array.isArray(data.facilities)) ? data.facilities : [];
        bpFacilities.textContent = (arr.length ? arr.join(", ") : "-");
      }

      if (bpUnits) {
        const u = data.unitsByOwnerId || {};
        const entries = Object.entries(u);
        bpUnits.textContent = entries.length ? entries.map(([k,v]) => `${k}:${v}`).join("  /  ") : "-";
      }

      if (bpSeen) {
        if (!data.visible && data.lastSeenDay !== null && data.lastSeenDay !== undefined) {
          bpSeen.textContent = ` : day ${data.lastSeenDay}`;
        } else if (!data.visible) {
          bpSeen.textContent = ` `;
        } else {
          bpSeen.textContent = "";
        }
      }
    } catch (e) {
      // ignore
    }
  }



