  function askSoldiersToMove(max) {
    const m = Number(max || 0);
    if (!Number.isFinite(m) || m <= 0) return null;
    const raw = prompt(`    (1~${m})`, String(m));
    if (raw === null) return null;
    const n = parseInt(String(raw).trim(), 10);
    if (!Number.isFinite(n) || n < 1 || n > m) {
      showError(`    . (1~${m})`);
      return null;
    }
    return n;
  }

