  if (btnTechUnlock) btnTechUnlock.addEventListener("click", async () => {
    if (!canTechUnlock()) return;

    const myTp = (GAME.techPointsByOwner && GAME.userOwnerId) ? (GAME.techPointsByOwner[GAME.userOwnerId] ?? 0) : 0;
    const unlocked = new Set((GAME.unlockedTechByOwner && GAME.userOwnerId) ? (GAME.unlockedTechByOwner[GAME.userOwnerId] || []) : []);

    const lines = TECH_CATALOG.map((t, i) => {
      const done = unlocked.has(t.code) ? " ()" : "";
      return `${i + 1}. ${t.name} [${t.code}] /  ${t.cost} / ${t.desc}${done}`;
    }).join("\n");

    const pick = prompt(` \n TP: ${myTp}\n\n${lines}\n\n    (=)`);
    if (!pick) return;

    let code = String(pick).trim().toUpperCase();
    if (/^\d+$/.test(code)) {
      const idx = Number(code) - 1;
      if (idx < 0 || idx >= TECH_CATALOG.length) {
        alert(" .");
        return;
      }
      code = TECH_CATALOG[idx].code;
    }

    try {
      const s = await window.OCC_API?.gameUnlockTech?.(code);
      if (s) applyGameState(s);
      alert(`  : ${code}`);
    } catch (e) {
      const msg = (e && e.message) ? e.message : String(e);
      alert(msg);
    }
  });

