  async function handleGameClick(info, id) {
    const key = info?.key;
    if (!key) return;
    updateBottomPanelByKey(key);

    //   
    if (GAME.phase === "PICK_HOME") {
      try {
        const aiCount = aiCountSel ? Number(aiCountSel.value || 1) : 1;
        const s = await window.OCC_API?.gameStart?.(key, aiCount);
        if (s) applyGameState(s);
        GAME.phase = GAME.finished ? "FINISHED" : "PICK_FROM";
        GAME.selectedFromKey = null;
        GAME.selectedToKey = null;
        const name = info?.name_ko || info?.name_en || "?";
        clickTxt.textContent = ` : ${info?.iso2 || "?"}  ${name} ( )`;
        updateGameUi();
      } catch (e) {
        // NOTE:       SyntaxError .
        showError("  :\n" + (e?.message || e));
      }
      return;
    }

    if (!GAME.started || GAME.finished) return;

    //  :
    // 1)    ->  
    // 2)    ->  ( /   )
    const ownerId = ownerIdOfKey(key);

    if (!GAME.selectedFromKey) {
      if (ownerId !== GAME.userOwnerId) return;
      GAME.selectedFromKey = key;
      GAME.selectedToKey = null;
      GAME.phase = "PICK_TO";
      const name = info?.name_ko || info?.name_en || "?";
      clickTxt.textContent = `: ${info?.iso2 || "?"}  ${name}`;
      updateGameUi();
      return;
    }

    //  
    if (ownerId === GAME.userOwnerId && key !== GAME.selectedFromKey) {
      GAME.selectedFromKey = key;
      GAME.selectedToKey = null;
      const name = info?.name_ko || info?.name_en || "?";
      clickTxt.textContent = ` : ${info?.iso2 || "?"}  ${name}`;
      updateGameUi();
      return;
    }

    //  
    if (key === GAME.selectedFromKey) return;
    GAME.selectedToKey = key;
    const name = info?.name_ko || info?.name_en || "?";
    clickTxt.textContent = `: ${info?.iso2 || "?"}  ${name}`;
    updateGameUi();
  }

