  function resolveKeyFromSearchValue(v) {
    const list = document.getElementById("regionList");
    const opts = list.children;
    for (let i=0; i<opts.length; i++) {
      const o = opts[i];
      if (o.value === v) return o.getAttribute("data-key");
    }
    const vv = (v || "").trim();
    if (!vv) return null;
    for (let i=0; i<opts.length; i++) {
      const o = opts[i];
      if (o.value.includes(vv)) return o.getAttribute("data-key");
    }
    return null;
  }
  document.getElementById("focusBtn").addEventListener("click", () => {
    const v = document.getElementById("searchBox").value;
    const key = resolveKeyFromSearchValue(v);
    if (key) focusKey(key);
  });
  document.getElementById("searchBox").addEventListener("keydown", (e) => {
    if (e.key === "Enter") {
      e.preventDefault();
      document.getElementById("focusBtn").click();
    }
  });

